import React from 'react';

const Division = () => {
  const publicUrl = process.env.PUBLIC_URL || "";

  return (
    <div>
      <div
        style={{
          backgroundImage: `url(${publicUrl}/assets/img/blog/division/D1.svg)`,
          backgroundRepeat: 'no-repeat',
          backgroundSize: '100% auto', 
          backgroundPosition: 'center', 
          height: '700px',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <h1 style={{fontSize:'180px', boxShadow:"2px 2px "}}  className="text-white font-extrabold sm:text-7xl md:text-9xl drop-shadow-[5px_5px_10px_rgba(255,0,255,0.6)]">
          D1
        </h1>
      </div>
    </div>
  );
};

export default Division;
